import { Button, Table } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css"
import { render } from '@testing-library/react';

const columns = [
  {
    title: 'Id',
    dataIndex: 'id',
    render: (value) => {
      return (
        <a
          onClick={(event) => event.stopPropagation()}
          href={value}

        >
          salom
        </a>
      );
    }
  },
  {
    title: 'Name',
    dataIndex: 'name',
  },
  {
    title: 'Price',
    dataIndex: 'price',
  },
  {
    title: 'Status',
    dataIndex: 'is_active',
    render: (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose /></h1>)}</div>


  },
  {
    title: "Edit",
    key: "edit",
    width: "5%",
    render: () => {
      return <div><Button style={{ background: 'orange', color: 'white' }} type="text">Edit</Button></div>
    }
  },
  {
    title: "Delete",
    key: "delete",
    width: "5%",
    render: () => {
      return <div><Button type="danger">O'chirish</Button></div>
    }
  },
];
const columns1 = [
  {
    title: 'Id',
    dataIndex: 'depozit',
  },
  {
    title: 'Name',
    dataIndex: 'year',
  },
  {
    title: 'Price',
    dataIndex: 'engine',
  },
  {
    title: 'Status',
    dataIndex: 'is_active',
    render: (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose /></h1>)}</div>


  },
  {
    title: "Edit",
    key: "edit",
    width: "5%",
    render: () => {
      return <div><Button style={{ background: 'orange', color: 'white' }} type="text">Edit</Button></div>
    }
  },
  {
    title: "Delete",
    key: "delete",
    width: "5%",
    render: () => {
      return <div><Button type="danger">O'chirish</Button></div>
    }
  },
];


const Tables = () => {
  const [selectedRowKeys, setSelectedRowKeys] = useState([]);
  const [loading, setLoading] = useState(false);
  const [data, setdata] = useState([])



  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata(res.data)
    })
  }
  useEffect(() => {
    getData()
  }, [])

  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 100);
  };


  return (
    <div>
      <Table className='table' onRow={(record, rowIndex) => {
        return {
          onClick: event => { },
        };
      }} columns={columns} dataSource={data} /> 
      <Table className='table1' columns={columns1} dataSource={data} />
    </div>
  );
};
export default Tables;
